window.bookSummaryJSON = "A group of terrorists invades the White House, driving the president into an underground bunker, where he can't communicate with his government. Mitch Rapp, the CIA's top counter-terrorist operative, sneaks into the executive mansion to take control and finds that the terrorists are the least of the president's and the nation's problems."; 
